contracts/5_Wallet.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.3;

contract Wallet{
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "No tenes permiso");
        _;
    }

    function withdrawBalance(uint256 amount, address destination) public onlyOwner {
        require(address(this).balance >= amount , "Insuficient founds.");
        payable(destination).transfer(address(this).balance);
    }

    function depositBalance() external payable {
    }

    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }

}

